  if (arg[0]) {
    casadi_copy(arg[0], 48, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 48);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 48, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 48);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 127, d_nlp.lam+48);
  } else {
    casadi_clear(d_nlp.lam+48, 127);
  }
  if (arg[2]) {
    casadi_copy(arg[2], 48, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 48, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 48, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 48, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 127, d_nlp.lbz+48);
  } else {
    casadi_fill(d_nlp.lbz+48, 127, -casadi_inf);
  }
  if (arg[5]) {
    casadi_copy(arg[5], 127, d_nlp.ubz+48);
  } else {
    casadi_fill(d_nlp.ubz+48, 127, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s39;
  p.sp_a = casadi_s22;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
